'''GET OVER'''是TV动画《[[棋魂]]》的第一话到第三十话的主题曲。Dream乐队于2001年11月28日发卖的第十一首单曲。

棋魂的代表曲。此曲采用了迪斯科系电子舞曲的四节拍均衡低音鼓节奏（Four on the Floor<ref name="Four on the floor">[http://en.wikipedia.org/wiki/Four_on_the_floor_%28music%29 Four on the Floor]，英文维基。</ref>, 4つ打ち），节奏感极强。DREAM在此曲中声音非常强而有力。歌词非常励志，令人觉得十分亢奋。

